import { Routes, Route } from "react-router-dom";
import LandingPage from "../src/components/pages/LandingPage";
//import AuctionCar from "../src/components/pages/AuctionCar"; // Import AuctionCar component

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<LandingPage />} />
        <Route path="/auctioncar" element={<AuctionCar />} /> {/* Add route for AuctionCar */}
      </Routes>
    </>
  );
}

export default App;
